import { React, useState, useRef } from 'react'
import Popup from 'reactjs-popup';
import { useNavigate } from 'react-router-dom'
import './Ride.css'
import 'reactjs-popup/dist/index.css'
import NavBar from './NavBar';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

export default function RequestRide() {
  const navigate = useNavigate()

  const [source, setSource] = useState("")
  const [destination, setDestination] = useState("")
  const [usingNow, setUsingNow] = useState(false)
  const [date, setDate] = useState(new Date())
  const [fieldsNotValid, setFieldsNotValid] = useState(true)

  const startRef = useRef()
  const endRef = useRef()
  const vehicleRef = useRef()
  const pickupRef = useRef()
  const nowRef = useRef()

  const isSourceValid = () => {
    return source !== ''
  }

  const isDestinationValid = () => {
    return destination !== ''
  }

  const isTimeValid = () => {
    var now = new Date()

    console.log("usingNow: " + usingNow + " now: " + now.getTime() + " date: " + date.getTime())
    console.log("isBefore: " + (now.getTime() < date.getTime()))
    return usingNow || now.getTime() < date.getTime()
  }

  const handleDateChange = (date) => {
    setDate(date)

    handleFieldsChange()
  }

  const handleFieldsChange = () => {
    console.log(startRef.current.value)
    console.log(endRef.current.value)
    console.log(vehicleRef.current.value)
    console.log(nowRef.current.checked)

    if (nowRef.current.checked) {
      setUsingNow(true)
    } else {
      setUsingNow(false)
    }

    setSource(startRef.current.value)
    setDestination(endRef.current.value)

    var timeValid = isTimeValid()
    console.log("isTimeValid: " + timeValid)
    setFieldsNotValid(!(isSourceValid() && isDestinationValid() && timeValid))
  }

  const dateIsInPast = (date) => new Date() < date;

  const onCancelClick = () => {
    navigate('/home');
  }

  const onOKClick = () => {
    navigate('/home');
  }

  return (
    <div className='mainContainer'>
      <NavBar titleString="Request a Ride" selectedTab="1" />
      <div className='contentContainer'>
        <div className='inputContainer'>
          <p className='inputLabel'>Start address:</p>
          <input
            className={isSourceValid() ? 'required inputBox' : 'error inputBox'}
            ref={startRef}
            onChange={handleFieldsChange}
          />
          <button className='requestButton' >Search...</button>
          <button className='requestButton' >My Location</button>
        </div>
        <div className='inputContainer'>
          <p className='inputLabel'>Destination:</p>
          <input
            className={isDestinationValid() ? 'required inputBox' : 'error inputBox'}
            ref={endRef}
            onChange={handleFieldsChange}
          />
          <button className='requestButton' >Search...</button>
        </div>

        <div className='inputContainer'>
          <label for="vehilce">Vehicle Type:</label>

          <select
            name="vehicle"
            ref={vehicleRef}
            id="vehicle"
            onChange={handleFieldsChange}>
            <option value="car">Car</option>
            <option value="truck">Truck</option>
            <option value="van">Van</option>
            <option value="shuttle">Shuttle</option>
          </select>
        </div>

        <div className='inputContainer'>
          <p className='inputLabel'>Pickup time:</p>
          <div className="checkItem">
            <label for="now">
              <input type="checkbox" ref={nowRef} name="now" onClick={handleFieldsChange} className={isTimeValid() ? 'required' : 'error'} />
              Now
            </label>
          </div>
          <p>-OR-</p>
          <DatePicker
            ref={pickupRef}
            disabled={usingNow}
            showTimeSelect
            filterDate={dateIsInPast}
            selected={date}
            onChange={(date) => handleDateChange(date)}
            dateFormat="MMMM d, yyyy h:mmaa"
            className={isTimeValid() ? "required datePicker" : "error datePicker"}
          />
        </div>

        <div className='submitContainer'>
          <button className='cancelButton requestButton' onClick={onCancelClick} >Cancel</button>
          <Popup trigger=
            {<button className='requestButton submitButton' disabled={fieldsNotValid}>Submit</button>}
            modal nested className='modal'>
            <p>Thank you, your ride is scheduled.</p>
            <button className='requestButton' onClick={onOKClick}>OK</button>
          </Popup>
        </div>
      </div>
    </div>
  )
}
